def turn_off_last_bit(S):

    SS = S & (S - 1)
    b = (SS ^ S).bit_length() - 1
    return (SS, b) if S else (SS, -1)

def is_neighbor(a, b):

    if "Caerleon" in [a, b]:
        return True
    cities = ["Lymhurst", "Bridgewatch", "Martlock", "Thetford", "Fort Sterling"]
    start = cities.index(a)
    check_a = start - 1
    check_b = start + 1
    if check_a < 0:
        check_a = len(cities) - 1
    if check_b >= len(cities):
        check_b = 0
    return b in [cities[check_a], cities[check_b]]

