def ED_fn(t, t_bench, R_bench, model):


    tstar = t/t_bench

    if model == 'TM99-simple':
        # power law R~t
        Rstar = tstar
    elif model == 'TM99-0':
        # TM99, Table 5
        Rstar = 2.01*tstar*(1. + 1.72 * tstar**(3./2.))**(-2./3.)

    return R_bench*Rstar

