def split_alpha(im):


    if im.mode == 'RGBA':
        # NOTE: `merge` is slower than `convert` when using Vanilla Pillow
        a = im.split()[3]
        im = im.convert('RGB')
        return im, a
    elif im.mode == 'RGB':
        return im, None
    else:
        raise ValueError('Unsupported mode: ' + im.mode)

