def flatten_filesystem(entry, metadata):

    return list(
        map(
            lambda entity: {
                'entity': entity[0],
                'state': entity[1]['entity_state'],
                'entry': entity[1].get('entry', '{} <current>'.format(entry)),
            },
            metadata['filesystem']['entities'].items()
        )
    )

