def filter_bytes(unfiltered: bytes, struct_fmt: str):

    if len(unfiltered) == 1:
        unfiltered = unfiltered[0]
    elif len(unfiltered) > 1:
        unfiltered = list(unfiltered)
    if 's' in struct_fmt:
        filtered = str(bytes(filter(None, unfiltered)), 'UTF-8')
    else:
        filtered = unfiltered
    return filtered

